const INITIAL_STATE = {
  data:[]
}


export default function getCustomerBuilding( state= INITIAL_STATE, action){
  switch(action.type){
      case GET_ACCOUNT_BUILDING:

          return {
              ...state,
              data: action.payload
                      };
      default:
          return state;
  }
  
}
